import{_ as e,e as t}from"./app.a3b49842.js";const o={},a=t('<h1 id="requirements" tabindex="-1"><a class="header-anchor" href="#requirements" aria-hidden="true">#</a> Requirements</h1><p>To use these starter dashboards, you need:</p><ul><li><p><strong>Db2 Query Monitor</strong></p><p>You must set CQMPARMS to send data to OMEGAMON Data Provider by configuring the ODP Broker name and ODP Store Name.</p></li><li><p><strong>IBM Z OMEGAMON Data Provider</strong> (ODP)</p><p>The ODP APAR level must be at least OA64880.</p><p>You must have configured ODP to forward data to Logstash.</p></li><li><p><strong>Elastic Stack</strong></p><p>The starter dashboards and related Elastic Stack artifacts were developed and tested in Elastic Stack <strong>7.15.2</strong>. For compatibility with other versions of Elastic Stack, see the Elastic Stack documentation.</p></li></ul><h2 id="screen-resolution" tabindex="-1"><a class="header-anchor" href="#screen-resolution" aria-hidden="true">#</a> Screen resolution</h2><p>The dashboards were developed on a screen with a resolution of 1920 \u2715 1080 pixels.</p><p>At lower resolutions, some dashboards might exhibit rendering issues.</p><h2 id="what-you-need-to-know" tabindex="-1"><a class="header-anchor" href="#what-you-need-to-know" aria-hidden="true">#</a> What you need to know</h2><p>To install the starter dashboards, you need to know how to configure the Elastic Stack.</p><p>To forward data to the Db2 Query Monitor starter dashboards, you need to know how to configure the following software on z/OS:</p><ul><li>Db2 Query Monitor CQMPARMS</li><li>OMEGAMON Data Provider (ODP)</li></ul><p>To use the starter dashboards, you need to know how to use Kibana, and you need to understand the attributes shown in the dashboards.</p>',11);function r(s,n){return a}var d=e(o,[["render",r]]);export{d as default};
